import React from 'react'
import './Habilidades.css'

const Habilidades = () => {
    return (
        <section className='contenidoPrincipal'>
            <h5>Habilidades</h5>

            <div className='contenido'>
            <div className='habilidades'></div>

            <div className='informacion'></div>
            </div>
        </section>
        
    );
};


export default Habilidades;
